import React, { Component } from "react";
import LoginPage from "./LoginPage";
import HomePage from "./HomePage";
class Conditional_Rendering extends Component {
  constructor(props) {
    super(props);

    this.state = {
      isLogin: false,
    };
  }

  render() {
    if (this.state.isLogin) {
      return <HomePage />;
    } else {
      return <LoginPage />;
    }
  }
}
export default Conditional_Rendering;
